INSERT INTO `sozlesmesablon` VALUES ('sozlesme_1766414903998_iuegkunuo','2025 Kontrat Şartları','1- ) Sözleşmenin imzalanması ile birlikte müşteri sözleşme bedelinin 1/3 ünü cayma tazminatı olarak İŞLETME SAHİBİNE\nöder. Bu cayma tazminatı TBK. M.178’e göre müşteriye iade edilmez.\n2-) Müşteri, İŞLETME SAHİBİ ve ilgili kurullar tarafından belirlenen tüm sağlık ve güvenlik kurallarına (özellikle korona\nvirüs tedbirlerine), davet sırasında gerek davet sahipleri gerekse konuklar tarafından uygun davranılacağını kabul ve\ntaahhüt etmektedir. Bu maddeye aykırılık halinde, İŞLETME SAHİBİ sözleşmeyi tek taraflı fesih edebileceği gibi uğramış\nolduğu zarar ve ziyanı tazmin sorumluluğu tamamen müşteriye aittir.\n3-) Ödeme ile ilgili sözleşmede belirtilen maddelere uyulmaması durumunda İŞLETME SAHİBİ hiçbir ihbar ve ihtara gerek\nkalmaksızın sözleşmeyi tek taraflı fesih ve daveti iptal etme hakkı vardır.Sözleşme imzalanmasına rağmen ödeme\nyapılmaması sebebiyle İŞLETME SAHİBİ tarafından sözleşmenin tek taraflı feshi ve davetin iptali halinde, o tarihe kadar\nMüşteri’den tahsil edilmiş olan hizmet bedeli Müşteri’ye iade edilmeyeceği gibi, İŞLETME SAHİBİ’nin işbu sözleşme ile\nbelirlenen toplam hizmet bedelinin tamamını da talep etme hakkı bulunmaktadır. Bu halde, Müşteri her ne nam adı altında\nolursa olsun herhangi bir hak, alacak, tazminat ve sair talep ve dava haklarının bulunmadığını beyan , kabul ve taahhüt\neder. 4-) İş bu sözleşme ile kararlaştırılan davetin Müşteri tarafından her ne sebep olursa olsun iptal edilmesi halinde, İŞLETME\nSAHİBİ’nin aşağıda belirtilen süreler esas alınarak, toplam hizmet bedelinin aşağıda belirtilen kısmını talep etme hakkı\nsaklıdır. Şöyle ki; Devlet tarafından önceki 90 gün veya daha öncesinde yapılacak iptallerde, sözleşme ile kararlaştırılan\ntoplam hizmet bedelinin %40’ı, Davet tarihinden önceki 60 gün ile 90 gün arasında yapılacak iptallerde, sözleşme ile\nkararlaştırılan, toplam hizmet bedelinin %60’ı Davet tarihinden önceki 30 gün ile 60 gün arasında yapılacak iptallerde,\nsözleşme ile kararlaştırılan toplam hizmet bedelinin %80’i, Davet tarihinden önceki son 30 gün içinde yapılacak iptallerde,\nsözleşme ile kararlaştırılan toplam hizmet bedelinin %100’ü. Herhangi bir ihbara ve ihtara gerek kalmaksızın, iptal\ntarihinde MÜŞTERİ tarafından İŞLETME SAHİBİ’ne CAYMA TAZMİNATI OLARAK ödenecektir. Ayrıca iptal tarihine kadar\nORGANİZATÖR’e yapılan ödemelerin yukarıdaki %’lerden fazla yapılmış olması halinde fazla ödenen kısım Müşteri’ye iade edilmez. Müşteri bu hususu peşinen kabul ve taahhüt eder.\n5-) Savaş, ayaklanma , sivil kargaşa, grev, lokavt, salgın hastalık, maliye ve diğer kazai makamların aşırı rezervasyona yol açacak türdeki kararları veya hizmet verilmesini engelleyici emir,karar, talimatname çıkarılması, yangın ve başka sebepten\nötürü ayrılan odaların hasar görmesi veya tahrip olması ayrılan odaların hizmete sunulmasını engelleyecek biçimde işçi\neksikliği veya yiyecek maddesi temin edilmemesi halleri, işbu sözleşme uyarınca ‘’MÜCBİR SEBEP’’olarak değerlendirilecektir. İşbu sözleşmede belirtilen ‘’Mücbir Sebep’’ hallerinden birinin gerçekleşmesi halinde, İŞLETME SAHİBİ’nin, işbu Devlet Sözleşmesi’ni karşı tarafa bildirmeksizin hiçbir yükümlülük altına girmeksizin iptal etme hakkına sahiptir. Müşteri bu durumda İŞLETME SAHİBİ’nin herhangi bir sorumluluğunun bulunmadığını peşinen kabul eder. İşbu sözleşmede belirtilen ‘’Mücbir Sebep’’ hallerinin birinin gerçekleşmesi İŞLETME SAHİBİ’nin işleyişinde herhangi bir aksamaya yol açmadığı halde, Müşteri’nin yukarıda belirtilen halleri sebep olarak gösterilerek davet organizasyonunu iptal etmesi durumunda, İŞLETME SAHİBİ’nin sözleşmede belirtilen iptal prosedürünü uygulama ve anılan hükme göre hizmet bedelini talep etmek hakkı bulunmaktadır.',1,'2025-12-22 14:48:23.998','2025-12-22 17:07:01.069');
